const ReviewForm = (props) => {
  return (
    <div>
      <form>
        <label>Leave a Review</label>
        <input type="text" name="title"></input>
        <textarea></textarea>
        <input type="text" name="user"></input>
        <input type="submit"></input>
      </form>
    </div>
  );
};

export default ReviewForm;
